import GerarNumeros from '../GeradorNumeros.tsx'
import './botao.css'

interface BotaoProps{
    children?: React.ReactNode 
    type?:'button' | 'submit' | 'reset' | undefined
    onClick?:() => void
}

function Botao({onClick, children,type}:BotaoProps){
    return(
        <div  className="Botao">
        <button
        onClick={onClick}
         type={type}
         >

            {children}
        </button>
        </div>
    )
}
export default Botao;
